  function animatePath(map, latlngs, durationMs) {
    const total = latlngs.length;
    const tailLen = Math.max(4, Math.floor(total * 0.16)); // 16% tail
    const line = L.polyline([], { color: DOT_COLOR, weight: 2, opacity: 0.9 }).addTo(map);
    const head = L.circleMarker(latlngs[0], {
      radius: 6, color: HEAD_GLOW, fillColor: HEAD_GLOW, fillOpacity: 1.0
    }).addTo(map);

    let startTime = null;
    function step(ts) {
      if (!startTime) startTime = ts;
      const elapsed = ts - startTime;
      const progress = Math.min(1, elapsed / durationMs);
      const idx = Math.floor(progress * (total - 1));
      const startIdx = Math.max(0, idx - tailLen);
      line.setLatLngs(latlngs.slice(startIdx, idx + 1));
      head.setLatLng(latlngs[idx]);
      const pulse = 4 + 3 * (0.5 + 0.5*Math.sin(Date.now()/120));
      head.setStyle({ radius: pulse });
      if (progress < 1) requestAnimationFrame(step);
      else setTimeout(() => { map.removeLayer(line); map.removeLayer(head); }, 60);
    }
    requestAnimationFrame(step);
  }

  function fireAll(map) {
    // Batch to avoid too many timers at once
    const batchSize = 30;
    const durationMs = 1400;
    let i = 0;
    function launchBatch() {
      const end = Math.min(paths.length, i + batchSize);
      for (; i < end; i++) {
        const delay = Math.random() * 900;
        setTimeout(((p) => () => animatePath(map, p, durationMs))(paths[i]), delay);
      }
      if (i < paths.length) setTimeout(launchBatch, 300);
    }
    launchBatch();
  }

  function ready(fn) {
    if (document.readyState !== 'loading') fn();
    else document.addEventListener('DOMContentLoaded', fn);
  }

  ready(function() {

      // Re-fire every 3s
      setInterval(go, 3000);
    });
  });
